import React from "react";

class Navbar extends React.Component {
  render() {
    <div>
      <div className="ui menu">
        <div className="item">
          <div className="ui primary button">Sign up</div>
        </div>
        <div className="item">
          <div className="ui button">Log-in</div>
        </div>
      </div>
    </div>;
  }
}

export default Navbar;
